import { DefaultTheme } from 'styled-components';

export const theme: DefaultTheme = {
    main: "##D9AD2B",
    logo: {
        bk: "#000",
        brown: "#8e5f1a",
        yellow: "#e0bd2b",
        pink: "#d3599c",
    },
    dark: {
        darker: "#181818",
        lighter: "#2F2F2F",
    },
    light: {
      lighter: "#fff",
      darker: "#e5e5e5",
    }
}
